import React from 'react';
import NewsItem from './NewsItem';

function NewsList({ news }) {
  return (
    <div className="news-list">
      {news.length === 0 ? (
        <p>검색 결과가 없습니다.</p>
      ) : (
        news.map((item, index) => (
          <NewsItem key={index} news={item} />
        ))
      )}
    </div>
  );
}

export default NewsList;
